import { ReactSVG } from "react-svg";
import pinIcon from "./objects/pinIcon.svg"

const places = {
    place: "London",
    country: "UK",
    coverImg: require("./objects/London.jpg"),

    googleMapLink: "https://www.google.com/maps/place/London,+UK/data=!4m2!3m1!1s0x47d8a00baf21de75:0x52963a5addd52a99?sa=X&ved=2ahUKEwjRnPit6vL8AhXUR_EDHUCpBG8Q8gF6BQiCARAB"
}

export default function Place () {
    return (
        <div className="place">
                <img src= {places.coverImg} className="place--coverImg" alt={places.place}/>
                <div className="place--info">
                    <div className="place--link">
                        <ReactSVG src={pinIcon}/>
                        <p>{places.country} <a href="https://www.google.com/maps/place/London,+UK/data=!4m2!3m1!1s0x47d8a00baf21de75:0x52963a5addd52a99?sa=X&ved=2ahUKEwjRnPit6vL8AhXUR_EDHUCpBG8Q8gF6BQiCARAB">View on Google Maps</a></p>
                    </div>
                </div>
        
        </div>
    )
}
